description:
Quality Lyrics, Dangerous Delivery. Underground hip-hop artist from Florida, D.P. 13 track mixtape, this dude has a lot of hype behind him right now down south, check out the next up-coming rapper to blow from Florida. 

Quotes: &quot;Almost every song was banger. You have a excellent flow and delivery, remind me of Luda. Will deff have this in the tape deck for a while, and is in my top releases 07 for sure.&quot; - UK Artist &amp;#039;Eclipse&amp;#039; 

&quot;Been bumpin this on repeat for a few hours now, im really feelin this, nice choices for the beats. My favorites are &quot;Dear god&quot; &quot;Bobbin my Head&quot; and &quot;Tha business&quot;. Real nice man keep it up.&quot; -Houston Producer DirtyThirdBeats
